een goeie film

met Val Kilmer, Stephen Dorff en Harold Perrineau

Een brave familievader met een veelbelovende toekomst verliest alles wat hij heeft, wanneer hij een inbreker in zijn huis per 
ongeluk doodmaakt. Veroordeeld voor onvrijwillige doodslag, moet hij de komende drie jaar doorbrengen in een zwaarbewaakte 
gevangenis waar de regels van de normale maatschappij niet langer gelden.
